import React from "react";
const array = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];
function NavBar() {
  array.map((props) => {
    console.log(props);
    return (
      <>
        <div key={props.type}>{props.type}</div>
        <></>
        <span>{props.icon}</span>
      </>
    );
  });
}

export default NavBar;
